  false,\n\t\"url\": null,\n\t\"notes\": \"Report of investigations analyses of drillers'
  and geophysical logs, cuttings, and 29 core samples from well Nc13-3 near Greenwood,
  Sussex County, Delaware indicate that the l500-foot section penetrated by the drill
  can be divided into seven rock-stratigraphic units: Matawan Formation, Monmouth
  Formation, unit A, Piney Point Formation, Chesapeake Group (undifferentiated), Staytonville
  unit, and the Columbia Formation. The rock units are identified on the basis of
  texture, mineralogy, color, and interpretation of electric and gamma-ray logs. The
  oldest rocks penetrated are Upper Cretaceous; Tertiary and Quaternary rocks were
  also encountered.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
